window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"22.0.0","implementation":{"name":"cucumber-jvm","version":"7.13.0"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"17+35-LTS-2724"},"os":{"name":"Windows 10"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1747252374,"nanos":958264100}}},{"source":{"uri":"classpath:features/cart.feature","data":"# language: pt\n@Carrinho\nFuncionalidade: Gerenciamento de itens no carrinho do SwagLabs Mobile\n  Como um usuário do aplicativo SwagLabs Mobile\n  Eu quero adicionar, visualizar e remover produtos do carrinho\n  Para poder gerenciar minha compra\n\n  Contexto:\n    Dado que estou logado no aplicativo SwagLabs Mobile com o usuário \"standard_user\" e senha \"secret_sauce\"\n    E estou na tela de lista de produtos\n\n  @AdicionarProduto\n  Cenario: Adicionar um produto ao carrinho\n    Quando tocar no botão \"ADD TO CART\" do primeiro produto\n    Então o contador do carrinho deve exibir \"1\"\n    E o botão do produto deve mudar para \"REMOVE\"\n\n  @VisualizarCarrinho\n  Cenario: Visualizar produtos no carrinho\n    Quando adicionar um produto ao carrinho\n    E tocar no ícone do carrinho\n    Então devo ser redirecionado para a tela do carrinho\n    E devo visualizar o produto adicionado no carrinho\n    E devo visualizar o preço correto do produto\n\n  @RemoverProdutoCarrinho\n  Cenario: Remover um produto da tela do carrinho\n    Quando adicionar um produto ao carrinho\n    E tocar no ícone do carrinho\n    E tocar no botão \"REMOVE\" do produto no carrinho\n    Então o carrinho deve ficar vazio\n    E devo visualizar a mensagem \"No Items\"\n\n  @RemoverProdutoTelaLista\n  Cenario: Remover um produto da lista de produtos\n    Quando tocar no botão \"ADD TO CART\" do primeiro produto\n    E o contador do carrinho deve exibir \"1\"\n    E tocar no botão \"REMOVE\" do produto\n    Então o contador do carrinho deve exibir \"0\"\n    E o botão do produto deve mudar para \"ADD TO CART\"\n\n  @AdicionarMultiplosProdutos\n  Cenario: Adicionar múltiplos produtos ao carrinho\n    Quando adicionar 2 produtos diferentes ao carrinho\n    Então o contador do carrinho deve exibir \"2\"\n    Quando tocar no ícone do carrinho\n    Então devo visualizar os 2 produtos no carrinho","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/cart.feature","feature":{"location":{"line":3,"column":1},"tags":[{"location":{"line":2,"column":1},"name":"@Carrinho","id":"743dce60-c8c0-4676-9bf4-b95e6ac63e96"}],"language":"pt","keyword":"Funcionalidade","name":"Gerenciamento de itens no carrinho do SwagLabs Mobile","description":"  Como um usuário do aplicativo SwagLabs Mobile\n  Eu quero adicionar, visualizar e remover produtos do carrinho\n  Para poder gerenciar minha compra","children":[{"background":{"location":{"line":8,"column":3},"keyword":"Contexto","name":"","description":"","steps":[{"location":{"line":9,"column":5},"keyword":"Dado ","keywordType":"Context","text":"que estou logado no aplicativo SwagLabs Mobile com o usuário \"standard_user\" e senha \"secret_sauce\"","id":"3be7ccf7-397c-4e85-b843-47f36b3e93f9"},{"location":{"line":10,"column":5},"keyword":"E ","keywordType":"Conjunction","text":"estou na tela de lista de produtos","id":"dafc336b-72e7-4f80-8802-fe65dc6cd576"}],"id":"5752ed02-40c4-4d0f-8a88-f9c1c9881939"}},{"scenario":{"location":{"line":13,"column":3},"tags":[{"location":{"line":12,"column":3},"name":"@AdicionarProduto","id":"287583b0-3821-40f7-ae0b-0c0e69b3bd34"}],"keyword":"Cenario","name":"Adicionar um produto ao carrinho","description":"","steps":[{"location":{"line":14,"column":5},"keyword":"Quando ","keywordType":"Action","text":"tocar no botão \"ADD TO CART\" do primeiro produto","id":"4ff55ff1-08f0-4928-bca0-4c1fcccafef9"},{"location":{"line":15,"column":5},"keyword":"Então ","keywordType":"Outcome","text":"o contador do carrinho deve exibir \"1\"","id":"ed2a98bf-5d12-4e6c-8236-44429877ce5e"},{"loca    | senha        |\n      | standard_user | secret_sauce |\n      | problem_user  | secret_sauce |\n\n  @LoginInvalido\n  Esquema do Cenario: Login inválido no aplicativo\n    Quando inserir o usuário \"<usuario>\"\n    E inserir a senha \"<senha>\"\n    E tocar no botão Login\n    Então devo visualizar a mensagem de erro \"<mensagem>\"\n\n    Exemplos:\n      | usuario        | senha           | mensagem                                                                |\n      | locked_out_user | secret_sauce   | Sorry, this user has been locked out.                                   |\n      | invalid_user    | secret_sauce   | Username and password do not match any user in this service.            |\n      | standard_user   | wrong_password | Username and password do not match any user in this service.            |\n      |                 | secret_sauce   | Username is required                                                   |\n      | standard_user   |                | Password is required                                                   |\n\n  @CamposObrigatorios\n  Cenario: Verificar campo de usuário obrigatório\n    Quando inserir a senha \"secret_sauce\"\n    E tocar no botão Login\n    Então devo visualizar a mensagem de erro \"Username is required\"\n\n  @CamposObrigatorios\n  Cenario: Verificar campo de senha obrigatório\n    Quando inserir o usuário \"standard_user\"\n    E tocar no botão Login\n    Então devo visualizar a mensagem de erro \"Password is required\"\n\n\n  @Logout\n  Cenario: Realizar logout após login bem-sucedido\n    Quando inserir o usuário \"standard_user\"\n    E inserir a senha \"secret_sauce\"\n    E tocar no botão Login\n    Então devo ser redirecionado para a tela inicial do aplicativo\n    Quando tocar no menu lateral\n    E selecionar a opção de Logout\n    Então devo retornar para a tela de login","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/login.feature","feature":{"location"
